%% 反向倒推法
omgs6 = [0 1 0]';
p06 = [(L(1)+L(2)), W(1)+W(2) ,H(1)-H(2)]'
vs6 = cross(omgs6, -p06); % 可以发现W维度的信息因为叉乘而被消去了
S(:,6) = [omgs6; vs6];

omgs5 = [0 0 -1]';
p05 = [L(1)+L(2) W(1) 0]';
vs5 = cross(omgs5,-p05);
S(:,5) = [omgs5; vs5];

omgs4 = [0 1 0]';
p04 = [L(1)+L(2) 0 H(1)]';
vs4 = cross(omgs4, -p04);
S(:,4) = [omgs4; vs4];

omgs3 = [0 1 0]';
p03 = [L(1) 0 H(1)]';
vs3 = cross(omgs3, -p03);
S(:,3) = [omgs3; vs3];

omgs2 = [0 1 0]';
p02 = [0 0 H(1)]';
vs2 = cross(omgs2, -p02);
